- input: "TEXT\x1CC00110197\x1CSB21B.7259.TEXT\x1CSB21B.7259\x1CSB21B\x1CThis memo
    refers to the in-kind contribution of $59.41 from Dickstein Shapiro LLP for administrative
    costs, which is reflected on lines 17 and 21b of this report.  These in-kind services
    provided by the firm represent very limited staff time, overhead, supplies, and
    postage associated with other functions, such as raising funds for the PAC.  No
    separate staff or office space is available for PAC administrative functions and
    almost all communication is via internet.  Thus, resulting administrative costs
    are minimal."
